import React from "react";
import { useNavigate } from "react-router-dom";

function Dashboard() {
  const navigate = useNavigate();

  return (
    <div
      style={{
        minHeight: "100vh",
        background: "linear-gradient(135deg, #667eea, #764ba2)",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <div
        style={{
          background: "#ffffff",
          padding: "40px",
          borderRadius: "12px",
          width: "400px",
          textAlign: "center",
          boxShadow: "0px 10px 30px rgba(0,0,0,0.2)",
        }}
      >
        <h1 style={{ marginBottom: "10px", color: "#333" }}>
          AI Project Evaluator
        </h1>

        <p style={{ color: "#666", marginBottom: "30px" }}>
          Smart evaluation powered by AI & GPT
        </p>

        {/* New Submission Card */}
        <div
          onClick={() => navigate("/new")}
          style={{
            background: "#4CAF50",
            color: "white",
            padding: "20px",
            borderRadius: "10px",
            marginBottom: "20px",
            cursor: "pointer",
            transition: "0.3s",
          }}
          onMouseOver={(e) =>
            (e.currentTarget.style.background = "#43a047")
          }
          onMouseOut={(e) =>
            (e.currentTarget.style.background = "#4CAF50")
          }
        >
          <h3>âž• New Submission</h3>
          <p style={{ fontSize: "14px" }}>
            Submit a project for evaluation
          </p>
        </div>

        {/* View Submissions Card */}
        <div
          onClick={() => navigate("/view")}
          style={{
            background: "#2196F3",
            color: "white",
            padding: "20px",
            borderRadius: "10px",
            cursor: "pointer",
            transition: "0.3s",
          }}
          onMouseOver={(e) =>
            (e.currentTarget.style.background = "#1e88e5")
          }
          onMouseOut={(e) =>
            (e.currentTarget.style.background = "#2196F3")
          }
        >
          <h3>ðŸ“‚ View Submissions</h3>
          <p style={{ fontSize: "14px" }}>
            View & download previous reports
          </p>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
